PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?breed ?breedLabel ?origin ( IF( BOUND( ?minMass ) && BOUND( ?maxMass ) , CONCAT ( STR( ?minMass ) , ' - ' , STR( ?maxMass ) ) , '' ) AS ?massRange ) ( IF( BOUND( ?minHeight ) && BOUND( ?maxHeight ) , CONCAT ( STR( ?minHeight ) , ' - ' , STR( ?maxHeight ) ) , '' ) AS ?heightRange ) WHERE {
  VALUES ?breed {
    wd:Q37688 wd:Q39285
  }
  ?breed wdt:P31 wd:Q39367 .
  OPTIONAL {
    ?breed wdt:P495 ?origin .
  }
  OPTIONAL {
    ?breed wdt:P2067 ?mass .
  }
  OPTIONAL {
    ?breed wdt:P2048 ?height .
  }
  BIND( MIN( ?mass ) AS ?minMass ) BIND( MAX( ?mass ) AS ?maxMass ) BIND( MIN( ?height ) AS ?minHeight ) BIND( MAX( ?height ) AS ?maxHeight ) OPTIONAL {
    ?breed rdfs:label ?breedLabel .
    FILTER ( LANG( ?breedLabel ) = 'en' )
  }
}
GROUP BY ?breed ?breedLabel ?origin ?minMass ?maxMass ?minHeight ?maxHeight

